import React from "react";

import { useNavigate, useLocation } from "react-router-dom";
function Home(){
    const navigate = useNavigate();
    const location = useLocation();
    const data = location.state;
    console.log(data);
    return (
        <h1>Hello {data.first_name}</h1>
    );
}
export default Home
